message:
⚡️ MISSÃO ESPECIAL DE HOJE ⚡️ Divulgue as propostas 📝 do professor Fernando Haddad ✍️

🥩 Zerar o ICMS da carne e de todos os produtos da cesta básica pros paulistas voltarem a se alimentar bem;

🚏🚇 Bilhete Único Metropolitano, integrando as quatro regiões metropolitanas de São Paulo;

🥼 Construir 70 Hospitais Dia em todo estado para finalmente fazer a fila do SUS andar;

💰 Aumentar o salário mínimo paulista para R$ 1.580, valorizando de verdade os trabalhadores e as trabalhadoras;

📚 Criar os Institutos Estaduais de Educação com a mesma qualidade dos Institutos Federais pra oferecer o melhor ensino médio do Brasil;

🍛 Combater a fome e a miséria com distribuição emergencial de alimentos e leite;

🤎 Criar cotas para os concursos estaduais e municipais com 20% das vagas para pessoas negras e garantir equidade entre homens e mulheres em cargos do Governo;

🏠 Ampliar programas que garantam moradia imediata, como o Aluguel Social, o Auxílio Aluguel e o Serviço Social de Moradia;

🎒 Criar o Alfabetiza SP, programa de Alfabetização na Idade Certa para ajudar os alunos que tiveram a educação defasada durante a pandemia;

💰 Criar o Cartão Permanência Estudantil para combater o abandono estudantil;

👴 👵 Volta do Passe Livre do Idoso a partir dos 60 anos e ampliar para todo o estado;

🍽 Ampliar o Programa Bom Prato garantindo unidades próximo à áreas de grande concentração de estudantes;

👮‍♂️ Valorizar os policiais de todas as forças com a reestruturação das carreiras e investimento em tecnologia, além de plano de metas.

Curtiu? Deixe um ❤️  nessa mensagem e encaminhe para que mais 13 pessoas venham também para o #TimeHaddad.

Essas e mais propostas estão disponíveis pelo link 👉🏽https://haddadoficial.com.br/propostas

